local thestring = ""
local image = Image.Create(AssetLocation.Base64, thestring)
local thetimer = nil

function doit()
	if thetimer ~= nil and thetimer:GetSeconds() < 5 then
		if ClientLight then
			image:SetPosition(Vector2((Render.Width / 2) - 125, (Render.Height / 2) - 130))
			image:SetSize(Vector2(250,193.5))
			image:Draw()
		end
	else
		thetimer = nil
	end
end

function fireit()
	thetimer = Timer()
end


Events:Subscribe("Render", doit)
Network:Subscribe("FireBadass", fireit)